INSERT INTO `posts` (`id`, `title`, `category`, `created_at`, `updated_at`) VALUES
	(1, 'Iure enim omnis similique vitae alias ut ea aut nobis voluptas aut nesciunt delectus culpa vel iste sequi omnis temporibus nisi eaque sed sed omnis quo.', 'ipsa', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(2, 'Dolorum quidem soluta aut voluptatem incidunt enim sit voluptatem eligendi quis et est culpa numquam.', 'debitis', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(3, 'A culpa reprehenderit nam voluptate nostrum veniam rerum ea earum cupiditate reprehenderit nam soluta et similique earum omnis sunt veritatis molestias labore et iste nemo et et eligendi.', 'explicabo', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(4, 'Voluptas quidem qui illum impedit ab eius alias sint quia recusandae modi pariatur hic odio odio voluptatem doloribus voluptas laborum et quisquam quis facilis facere quae.', 'corrupti', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(5, 'Omnis dolorem recusandae odit non ducimus eum earum quaerat fuga rem eos magnam.', 'sit', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(6, 'Laboriosam et molestiae magnam ea beatae earum debitis omnis voluptates labore qui necessitatibus sunt rerum nulla tempore dolore dolorem corporis atque molestiae.', 'dolor', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(7, 'Ut blanditiis est voluptas ut iste laborum nam ullam illo dolores odit placeat neque dolor debitis officiis neque culpa hic ut assumenda veniam quis natus quod.', 'praesentium', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(8, 'Molestias et delectus velit aliquam aut sit non quos illum omnis nostrum quisquam nemo ipsa dolor architecto rem consequatur et.', 'cumque', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(9, 'Possimus earum illum sed voluptates soluta natus pariatur accusantium nihil ullam commodi tenetur.', 'reiciendis', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(10, 'Alias voluptatem consequatur modi ea et et odio quam debitis ipsa dolores enim eius dolorem qui hic rerum cum voluptatum molestiae nobis delectus.', 'et', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(11, 'Officiis laudantium at quia molestias et ab autem asperiores autem vel recusandae molestias numquam quia fuga doloribus laboriosam dolor consequatur eos quia.', 'dolor', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(12, 'Incidunt soluta est occaecati aut quia et aut incidunt iste voluptas delectus sint ipsam numquam quia eius.', 'nobis', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(13, 'Sit excepturi voluptatum esse consequatur sint nesciunt porro debitis qui voluptates suscipit rerum ut officia consequatur aut quasi sed nesciunt odit labore quidem consequatur eligendi distinctio praesentium perferendis.', 'quidem', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(14, 'Et minus veritatis natus iste ut voluptatem accusamus tenetur qui quae omnis sint sit minima architecto minima cumque unde fuga harum non nam maxime eum.', 'incidunt', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(15, 'Ut ipsa mollitia assumenda vel maiores libero qui aut qui ut suscipit sed et quae et quod et sed quae odit nulla impedit ex.', 'hic', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(16, 'Et et sed perspiciatis quo quae labore vel et accusantium et voluptates aliquid quo ratione eum animi cumque esse autem maiores accusamus facere consequatur dignissimos qui quibusdam.', 'praesentium', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(17, 'Earum velit quia expedita nihil neque ad ut velit quibusdam non voluptatem et ut corrupti et blanditiis suscipit.', 'doloremque', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(18, 'Dolor et quod aperiam id occaecati rem similique ea et quis quibusdam quas omnis et repellat at sit impedit sed.', 'velit', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(19, 'Enim possimus quis quidem est non tenetur cum a optio omnis neque sapiente recusandae impedit esse quibusdam nihil eos eveniet.', 'ut', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(20, 'Quam sint quia odio facilis facere inventore et aliquid aut non eos molestias repellendus voluptatem et dicta fugit libero est ut minus illo qui necessitatibus.', 'tenetur', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(21, 'Ut vel in consectetur quaerat sit et quae vero non debitis veritatis cum ipsa mollitia sit consequatur alias ut tempora et quas aut dolores quos.', 'inventore', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(22, 'Id est est itaque deleniti quam reiciendis sint suscipit quas hic quisquam accusantium saepe aliquam distinctio.', 'sit', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(23, 'Eius beatae aut non consectetur nisi atque occaecati eligendi qui et aut molestiae sit ratione qui tempora.', 'commodi', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(24, 'Et soluta autem iusto minima ea itaque amet voluptatem est rem qui nemo consequatur explicabo dolore a voluptatibus et velit aut.', 'amet', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(25, 'Exercitationem ut inventore similique hic exercitationem molestiae nostrum qui modi sunt et numquam sequi harum eum sed ut laudantium est sint magnam placeat cum consequatur dolore porro.', 'consequatur', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(26, 'Voluptatum recusandae esse modi corporis cupiditate unde officiis ut laborum possimus officia corrupti vel aut aut temporibus est non ipsam alias cumque nam.', 'vitae', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(27, 'Sit voluptates natus blanditiis possimus voluptas ullam dolorem optio necessitatibus aliquam laborum sit incidunt vel quisquam necessitatibus.', 'ut', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(28, 'Doloribus corporis sapiente est doloremque illo sint aliquid ullam nisi sit quo asperiores id quos dolorem molestiae rerum dolorem doloremque.', 'ea', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(29, 'Voluptatibus sed deleniti laudantium earum est quis vitae voluptas voluptate voluptas et voluptatum voluptatem quaerat asperiores vel iusto.', 'enim', '2023-01-21 23:50:39', '2023-01-21 23:50:39'),
	(30, 'Et qui consectetur voluptatem sed quisquam illo eum tempore ipsum sint nostrum perspiciatis rerum sed in sunt et quibusdam ea minus reprehenderit sunt quisquam et.', 'sed', '2023-01-21 23:50:39', '2023-01-21 23:50:39');
